import './App.css';
import MainBox from './Components/MainBox'

function App() {

  const getConversion = async () =>{
    fetch('https://java-unit-conversion.herokuapp.com/api/length/kilometer/1337')
    .then(response => response.json())
    .then(data => console.log(data))
  }

  return (
    <MainBox></MainBox>
  );
}

export default App;
